import React from 'react';
import Skeleton from '@material-ui/lab/Skeleton';
import './tab-skeleton.css';

export default function TabSkeleton(props){
	return (
		<div className='MuiListItem-root MuiListItem-gutters'>
			<Skeleton className='MuiListItemAvatar-root' animation="wave" variant="circle" width={40} height={40} />
			<div >
				<Skeleton className="MuiListItemText-root MuiListItemText-multiline" animation="wave" height={10} width="80%" />
				<Skeleton className="MuiListItemText-root MuiListItemText-multiline"  animation="wave" height={10} width="40%" />
			</div>
		</div>
		)
}
